import React from 'react';
import styles from './styles/basket.module.scss';
import { useDispatch } from 'react-redux';
import { useSelector } from 'react-redux';
import { increment } from '../../redux/slices/Busket';
import busketImg from '../../img/busket.svg';

const Basket = () => {
    const count = useSelector((state: any) => state.basket)

    return (
        <div className={styles.container}>
            <img src={busketImg} alt="busketImg" />
            <div className={`${styles.counter} ${count.value < 1 && styles.unvisible}`}>{count.value}</div>
        </div>
    );
};

export default Basket;
